const Form = () => {

    return(
        <form action="">
            <div>
                <label htmlFor="username">Username:</label>
                <input type="text" name="username"/>
            </div>

            <div>
                <label htmlFor="password">Password:</label>
                <input type="text" name="password" />
            </div>

        </form>
    );

};

export default Form;
